import React from 'react';
import BeerRow from './BeerRow';
import './css/Beers.css';

class Beers extends React.Component {
  render() {
    if (this.props.beerList1 != null && this.props.beerList2 != null) {
      return (
        <div className="beer-card">
          <BeerRow beerList={this.props.beerList1}></BeerRow>
          <BeerRow beerList={this.props.beerList2}></BeerRow>
        </div>
      ); 
    }
    else if (this.props.beerList1 != null) {
      return (
        <div className="beer-card">
          <BeerRow beerList={this.props.beerList1}></BeerRow>
        </div>
      ); 
    }
    else if (this.props.beerList != null) {
      return (
        <div className="beer-card">
          <BeerRow beerList={this.props.beerList2}></BeerRow>
        </div>
      ); 
    }
  }
}

export default Beers;
